import React, { Component } from "react";
import "./App.css";
import Navbar from "./Navbar";
import Search from "./Search";
import Footer from "./Footer";

//<Carousel />
class Main extends Component {
  render() {
    return (
      <React.Fragment>
        <div class="tab-content" id="pills-tabContent">
          <div
            class="tab-pane fade show active"
            id="pills-home"
            role="tabpanel"
          >
            ...
          </div>
          <div
            class="tab-pane fade"
            id="pills-profile"
            role="tabpanel"
          >
            ...
          </div>
          <div
            class="tab-pane fade"
            id="pills-contact"
            role="tabpanel"
            aria-labelledby="pills-contact-tab"
          >
            ...
          </div>
        </div>
        <Navbar />
        <div className="Area1">
          <Search />
        </div>
        <Footer />
      </React.Fragment>
    );
  }
}

export default Main;
